import {IMAGE} from "../actions/postImage"
import { render } from "react-dom"
import { actions } from "../actions/auth"

// const newImage = "test"
export const imageReducer = (state=newImage, action) => {
    switch (action.type){
        case IMAGE: 
        return {
            newImage : action.payload 
        }
        default: return state
    }
}
